import React, { useEffect, useState } from 'react';

function Summary() {
  const [botox, setBotox] = useState([]);
  const [botoxFullface, setBotoxFullface] = useState([]);

  useEffect(() => {
    // Busque os dados da sessionStorage e faça o parsing quando o componente for montado
    const botox = JSON.parse(sessionStorage.getItem('botox'));
    setBotox(botox);

    const botoxFullface = JSON.parse(sessionStorage.getItem('botoxFullface'));
    setBotoxFullface(botoxFullface);
  }, []);

  // Calcule o preço com base nos dadosArquivados
  if(botox > 0) { const precoBotox = botox * 1300 }
  if(botoxFullface > 0) { const precoBotoxFullface = botoxFullface * 1300 }

  return (
    <div>
      <div className="flex justify-center">
        <form className="pt-12" method="form" action="/summary">
          <div className="flex justify-center text-4xl text-white mb-10">Resumo</div>
          <ul id="list">
            <li>Botox: {botox} - {precoBotox}</li>
          </ul>
          <div className="flex justify-end text-white pt-4">
            <input type="submit" value="Submit" className="border rounded-md p-1" />
          </div>
        </form>
      </div>
    </div>
  );
}

export default Summary;
